import '../button/Button.scss';
import './Footer.scss'
import Button from '../../components/button/Button';
import ButtonComponent from '../../components/ButtonComponent/ButtonComponent';
import React from 'react';

function Footer({classFooter, nameBtn, buttonNext, buttonbackPage, showButtonWhite, showButtonBlue}){

    return (
      <footer className={classFooter}>
        <div className="container-footer1">
        <p>Powered by</p>
         <Button classBtn ="buttonLogo" nameBtn="Key Peoples Insights"/>
        </div>
        <div className="container-footer2">
          {/* <Button classBtn ="buttonWhite" nameBtn="Anterior" buttonClick={buttonbackPage} />
          <Button classBtn ="buttonBlue" nameBtn={nameBtn} buttonClick={buttonNext} /> */}
          <ButtonComponent nameBtn={nameBtn} buttonClick={buttonNext} color='red'/>
        </div>
      </footer>
    );
  };
  export default Footer;
